            var stayLoggedIn = Backendless.LocalCache.get("stayLoggedIn");
            var currentUserId = stayLoggedIn && Backendless.LocalCache.get("current-user-id");

            return currentUserId && persistence.of(User).findById(currentUserId) || null;
